@dataclass
class DependentPriceReferenceType:
    """<ns1:Component xmlns:ns1="urn:un:unece:uncefact:documentation:2">
    <ns1:ComponentType>ABIE</ns1:ComponentType> <ns1:DictionaryEntryName>Dependent
    Price Reference.

    Details</ns1:DictionaryEntryName> <ns1:Definition>A class to define
    the price of an item as a percentage of the price of a different
    item.</ns1:Definition> <ns1:ObjectClass>Dependent Price
    Reference</ns1:ObjectClass> </ns1:Component>

    :ivar percent: <ns1:Component
        xmlns:ns1="urn:un:unece:uncefact:documentation:2">
        <ns1:ComponentType>BBIE</ns1:ComponentType>
        <ns1:DictionaryEntryName>Dependent Price Reference.
        Percent</ns1:DictionaryEntryName> <ns1:Definition>The percentage
        by which the price of the different item is multiplied to
        calculate the price of the item.</ns1:Definition>
        <ns1:Cardinality>0..1</ns1:Cardinality>
        <ns1:ObjectClass>Dependent Price Reference</ns1:ObjectClass>
        <ns1:PropertyTerm>Percent</ns1:PropertyTerm>
        <ns1:RepresentationTerm>Percent</ns1:RepresentationTerm>
        <ns1:DataType>Percent. Type</ns1:DataType> </ns1:Component>
    :ivar location_address: <ns1:Component
        xmlns:ns1="urn:un:unece:uncefact:documentation:2">
        <ns1:ComponentType>ASBIE</ns1:ComponentType>
        <ns1:DictionaryEntryName>Dependent Price Reference. Location_
        Address. Address</ns1:DictionaryEntryName> <ns1:Definition>The
        reference location for this dependent price
        reference.</ns1:Definition>
        <ns1:Cardinality>0..1</ns1:Cardinality>
        <ns1:ObjectClass>Dependent Price Reference</ns1:ObjectClass>
        <ns1:PropertyTermQualifier>Location</ns1:PropertyTermQualifier>
        <ns1:PropertyTerm>Address</ns1:PropertyTerm>
        <ns1:AssociatedObjectClass>Address</ns1:AssociatedObjectClass>
        <ns1:RepresentationTerm>Address</ns1:RepresentationTerm>
        </ns1:Component>
    :ivar dependent_line_reference: <ns1:Component
        xmlns:ns1="urn:un:unece:uncefact:documentation:2">
        <ns1:ComponentType>ASBIE</ns1:ComponentType>
        <ns1:DictionaryEntryName>Dependent Price Reference. Dependent_
        Line Reference. Line Reference</ns1:DictionaryEntryName>
        <ns1:Definition>A reference to a line that the price is depended
        of.</ns1:Definition> <ns1:Cardinality>0..1</ns1:Cardinality>
        <ns1:ObjectClass>Dependent Price Reference</ns1:ObjectClass>
        <ns1:PropertyTermQualifier>Dependent</ns1:PropertyTermQualifier>
        <ns1:PropertyTerm>Line Reference</ns1:PropertyTerm>
        <ns1:AssociatedObjectClass>Line
        Reference</ns1:AssociatedObjectClass>
        <ns1:RepresentationTerm>Line Reference</ns1:RepresentationTerm>
        </ns1:Component>
    """

    percent: Optional[Percent] = field(
        default=None,
        metadata={
            "name": "Percent",
            "type": "Element",
            "namespace": "urn:oasis:names:specification:ubl:schema:xsd:CommonBasicComponents-2",
        },
    )
    location_address: Optional[LocationAddress] = field(
        default=None,
        metadata={
            "name": "LocationAddress",
            "type": "Element",
            "namespace": "urn:oasis:names:specification:ubl:schema:xsd:CommonAggregateComponents-2",
        },
    )
    dependent_line_reference: Optional[DependentLineReference] = field(
        default=None,
        metadata={
            "name": "DependentLineReference",
            "type": "Element",
            "namespace": "urn:oasis:names:specification:ubl:schema:xsd:CommonAggregateComponents-2",
        },
    )


