@dataclass
class TaxTotalType:
    """<ns1:Component xmlns:ns1="urn:un:unece:uncefact:documentation:2">
    <ns1:ComponentType>ABIE</ns1:ComponentType> <ns1:DictionaryEntryName>Tax Total.

    Details</ns1:DictionaryEntryName> <ns1:Definition>A class to
    describe the total tax for a particular taxation
    scheme.</ns1:Definition> <ns1:ObjectClass>Tax
    Total</ns1:ObjectClass> </ns1:Component>

    :ivar tax_amount: <ns1:Component
        xmlns:ns1="urn:un:unece:uncefact:documentation:2">
        <ns1:ComponentType>BBIE</ns1:ComponentType>
        <ns1:DictionaryEntryName>Tax Total. Tax Amount.
        Amount</ns1:DictionaryEntryName> <ns1:Definition>The total tax
        amount for a particular taxation scheme, e.g., VAT; the sum of
        the tax subtotals for each tax category within the taxation
        scheme.</ns1:Definition> <ns1:Cardinality>1</ns1:Cardinality>
        <ns1:ObjectClass>Tax Total</ns1:ObjectClass>
        <ns1:PropertyTerm>Tax Amount</ns1:PropertyTerm>
        <ns1:RepresentationTerm>Amount</ns1:RepresentationTerm>
        <ns1:DataType>Amount. Type</ns1:DataType> </ns1:Component>
    :ivar rounding_amount: <ns1:Component
        xmlns:ns1="urn:un:unece:uncefact:documentation:2">
        <ns1:ComponentType>BBIE</ns1:ComponentType>
        <ns1:DictionaryEntryName>Tax Total. Rounding Amount.
        Amount</ns1:DictionaryEntryName> <ns1:Definition>The rounding
        amount (positive or negative) added to the calculated tax total
        to produce the rounded TaxAmount.</ns1:Definition>
        <ns1:Cardinality>0..1</ns1:Cardinality> <ns1:ObjectClass>Tax
        Total</ns1:ObjectClass> <ns1:PropertyTerm>Rounding
        Amount</ns1:PropertyTerm>
        <ns1:RepresentationTerm>Amount</ns1:RepresentationTerm>
        <ns1:DataType>Amount. Type</ns1:DataType> </ns1:Component>
    :ivar tax_evidence_indicator: <ns1:Component
        xmlns:ns1="urn:un:unece:uncefact:documentation:2">
        <ns1:ComponentType>BBIE</ns1:ComponentType>
        <ns1:DictionaryEntryName>Tax Total. Tax Evidence_ Indicator.
        Indicator</ns1:DictionaryEntryName> <ns1:Definition>An indicator
        that this total is recognized as legal evidence for taxation
        purposes (true) or not (false).</ns1:Definition>
        <ns1:Cardinality>0..1</ns1:Cardinality> <ns1:ObjectClass>Tax
        Total</ns1:ObjectClass> <ns1:PropertyTermQualifier>Tax
        Evidence</ns1:PropertyTermQualifier>
        <ns1:PropertyTerm>Indicator</ns1:PropertyTerm>
        <ns1:RepresentationTerm>Indicator</ns1:RepresentationTerm>
        <ns1:DataType>Indicator. Type</ns1:DataType>
        <ns1:Examples>default is negative</ns1:Examples>
        </ns1:Component>
    :ivar tax_included_indicator: <ns1:Component
        xmlns:ns1="urn:un:unece:uncefact:documentation:2">
        <ns1:ComponentType>BBIE</ns1:ComponentType>
        <ns1:DictionaryEntryName>Tax Total. Tax Included_ Indicator.
        Indicator</ns1:DictionaryEntryName> <ns1:Definition>An indicator
        that tax is included in the calculation (true) or not
        (false).</ns1:Definition>
        <ns1:Cardinality>0..1</ns1:Cardinality> <ns1:ObjectClass>Tax
        Total</ns1:ObjectClass> <ns1:PropertyTermQualifier>Tax
        Included</ns1:PropertyTermQualifier>
        <ns1:PropertyTerm>Indicator</ns1:PropertyTerm>
        <ns1:RepresentationTerm>Indicator</ns1:RepresentationTerm>
        <ns1:DataType>Indicator. Type</ns1:DataType> </ns1:Component>
    :ivar tax_subtotal: <ns1:Component
        xmlns:ns1="urn:un:unece:uncefact:documentation:2">
        <ns1:ComponentType>ASBIE</ns1:ComponentType>
        <ns1:DictionaryEntryName>Tax Total. Tax
        Subtotal</ns1:DictionaryEntryName> <ns1:Definition>One of the
        subtotals the sum of which equals the total tax amount for a
        particular taxation scheme.</ns1:Definition>
        <ns1:Cardinality>0..n</ns1:Cardinality> <ns1:ObjectClass>Tax
        Total</ns1:ObjectClass> <ns1:PropertyTerm>Tax
        Subtotal</ns1:PropertyTerm> <ns1:AssociatedObjectClass>Tax
        Subtotal</ns1:AssociatedObjectClass> <ns1:RepresentationTerm>Tax
        Subtotal</ns1:RepresentationTerm> </ns1:Component>
    """

    tax_amount: Optional[TaxAmount] = field(
        default=None,
        metadata={
            "name": "TaxAmount",
            "type": "Element",
            "namespace": "urn:oasis:names:specification:ubl:schema:xsd:CommonBasicComponents-2",
            "required": True,
        },
    )
    rounding_amount: Optional[RoundingAmount] = field(
        default=None,
        metadata={
            "name": "RoundingAmount",
            "type": "Element",
            "namespace": "urn:oasis:names:specification:ubl:schema:xsd:CommonBasicComponents-2",
        },
    )
    tax_evidence_indicator: Optional[TaxEvidenceIndicator] = field(
        default=None,
        metadata={
            "name": "TaxEvidenceIndicator",
            "type": "Element",
            "namespace": "urn:oasis:names:specification:ubl:schema:xsd:CommonBasicComponents-2",
        },
    )
    tax_included_indicator: Optional[TaxIncludedIndicator] = field(
        default=None,
        metadata={
            "name": "TaxIncludedIndicator",
            "type": "Element",
            "namespace": "urn:oasis:names:specification:ubl:schema:xsd:CommonBasicComponents-2",
        },
    )
    tax_subtotal: list[TaxSubtotal] = field(
        default_factory=list,
        metadata={
            "name": "TaxSubtotal",
            "type": "Element",
            "namespace": "urn:oasis:names:specification:ubl:schema:xsd:CommonAggregateComponents-2",
        },
    )


